window.bookSummaryJSON = "<p>Meet Jack Stalwart. Code name: COURAGE. Jack is an ordinary kid who becomes a secret agent by night, thwarting evil all over the world as he searches for his missing brother, Max. </p> <p>Destination: Kenya - Finally Jack receives a coded message from Max! But before he can decipher it, Jack is called away on a mission to Kenya. Someone has been killing elephants for their ivory tusks. Can Secret Agent Jack Stalwart stop the poachers before more of these endangered animals are destroyed? Read more about Jack’s thrilling adventures as he travels the globe….</p>"; 
